#
# Structure for table "manage_user_login_log"
#

CREATE TABLE `manage_user_login_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `user_name` varchar(50) NOT NULL COMMENT '用户名称',
  `content` varchar(10000) DEFAULT NULL COMMENT '内容',
  `login_date` datetime NOT NULL COMMENT '登录日期',
  `leave_date` datetime DEFAULT NULL COMMENT '离开日期',
  `login_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '登录时长(秒)',
  `ip` varchar(200) DEFAULT NULL COMMENT '登录IP',
  `browser` varchar(100) DEFAULT NULL COMMENT '浏览器版本',
  `os` varchar(100) DEFAULT NULL COMMENT '操作系统',
  `session_id` varchar(50) DEFAULT NULL COMMENT 'sessionID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `session_id` (`session_id`),
  KEY `user_id` (`user_id`,`user_name`)
) ENGINE=MyISAM AUTO_INCREMENT=517 DEFAULT CHARSET=utf8 COMMENT='登录日志';

